/* nnom model */
static int8_t nnom_input_data[784];
static int8_t nnom_output_data[10];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[18];

	new_model(&model);

	layer[0] = Input(shape(28, 28, 1), nnom_input_data);
	layer[1] = model.hook(Conv2D(16, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_1_w, &conv2d_1_b), layer[0]);
	layer[2] = model.hook(DW_Conv2D(1, kernel(3, 3), stride(1, 1), PADDING_VALID, &depthwise_conv2d_1_w, &depthwise_conv2d_1_b), layer[1]);
	layer[3] = model.hook(Conv2D(24, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_2_w, &conv2d_2_b), layer[2]);
	layer[4] = model.active(act_relu(), layer[3]);
	layer[5] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_SAME), layer[4]);
	layer[6] = model.hook(Conv2D(24, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_3_w, &conv2d_3_b), layer[5]);
	layer[7] = model.hook(Conv2D(24, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_4_w, &conv2d_4_b), layer[6]);
	layer[8] = model.active(act_relu(), layer[7]);
	layer[9] = model.hook(Conv2D(32, kernel(3, 3), stride(2, 2), PADDING_SAME, &conv2d_5_w, &conv2d_5_b), layer[8]);
	layer[10] = model.active(act_relu(), layer[9]);
	layer[11] = model.hook(MaxPool(kernel(2, 2), stride(2, 2), PADDING_SAME), layer[10]);
	layer[12] = model.hook(Dense(64, &dense_1_w, &dense_1_b), layer[11]);
	layer[13] = model.hook(Dense(32, &dense_2_w, &dense_2_b), layer[12]);
	layer[14] = model.active(act_relu(), layer[13]);
	layer[15] = model.hook(Dense(10, &dense_3_w, &dense_3_b), layer[14]);
	layer[16] = model.hook(Softmax(), layer[15]);
	layer[17] = model.hook(Output(shape(10,1,1), nnom_output_data), layer[16]);
	model_compile(&model, layer[0], layer[17]);
	return &model;
}
